import React from "react";
import classes from "./menus.module.scss";
import AngleDown from "../../trifles/icons/AngleDown";
import AngleBtn from '../../trifles/AngleBtn';

const Menus = (props) => {
  return (
    <div className={classes.wrapper}>
      <div className={classes.menus}>
        {props.points.map((point) => (
          <button className={classes.point} key={`menus${point}`}>
            {point}
            <AngleDown />
          </button>
        ))}
      </div>
      <div className={classes.detailedMenu}>

      </div>
    </div>
  );
};

export default Menus;
